import React from 'react';
import { AppBar, Toolbar, Typography, Button, Avatar, Grid } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles((theme) => ({
  appBar: {
    backgroundColor: theme.palette.light.nav,
    color: theme.palette.light.logo,
  },
  title: {
    flexGrow: 1,
  },
  saveButton: {
    backgroundColor: 'grey',
    color: 'white',
    marginRight: theme.spacing(1),
  },
  runButton: {
    backgroundColor: 'green',
    color: 'white',
    marginRight: theme.spacing(2),
  },
  profileText: {
    marginRight: theme.spacing(1),
  },
}));

export default function NavBar({ user }) {
  const classes = useStyles();

  return (
    <AppBar position="static" className={classes.appBar}>
      <Toolbar>
        <Grid container alignItems="center" spacing={1}>
          <Grid item xs={5}>
            <Typography variant="h6" className={classes.title}>
              CREATE
            </Typography>
          </Grid>

          <Grid item xs={1}>
            <Button variant="contained" className={classes.saveButton}>
              üíæ Save
            </Button>
          </Grid>

          <Grid item xs={5}>
            <Button variant="contained" className={classes.runButton}>
              ‚ñ∂Ô∏è Run
            </Button>
          </Grid>

          <Grid item xs={0}>
            <Typography variant="body1" className={classes.profileText}>
              Hi, {user.name}
            </Typography>
          </Grid>

          <Grid item xs={1}>
            <Avatar src={user.profilePicture} />
          </Grid>
        </Grid>
      </Toolbar>
    </AppBar>
  );
}
